import React from 'react';
import "../../../node_modules/bootstrap/dist/css/bootstrap.min.css";
import "./../../../node_modules/flickity/dist/flickity.min.css";


function CheckCardgrp(playlist) {

    var arr = []
    for (let i = 0; i < playlist.playlist.length; i++) {
        const element = playlist.playlist[i];
        arr.push(element);
    }
    return (

        <div>
        {console.log(arr)}
            <div id="carouselExampleSlidesOnly" className="carousel slide" data-ride="carousel">
                <div className="carousel-inner">


                    {arr.map((p, index) => {
                        return (

                            <div className="carousel-item active bg-dark" key={index} >
                            {console.log(p.imageUrl)}

                                <img className="d-block w-100" src={p.imgUrl} alt="First slide" />
                            </div>
                        );
                    })}
                </div>
            </div>
        </div>
    );
}

export default CheckCardgrp;
